    true,nt"url": null,nt"notes": "The New River Geothermal Exploration (DOE
    Award No. EE0002843) is located approximately 25km south of the Salton Sea, near
    town of Brawley in Imperial County and approximately 150km east of San Diego, California.nnA
    total of 182 MT Logger sites were completed covering the two separate Mesquite and
    New River grids. The data was collected over a frequency range of 320Hz to 0.001Hz
    with variable site spacing. A number of different inversion algorithms in 1D, 2D
    and 3D were used to produce resistivity-depth profiles and maps of subsurface resistivity
    variations over the survey area. For 2D inversions, a total of eighteen lines were
    constructed in east-west and north-south orientations crossing the entire survey
    area. For MT 3D inversion, the New River property was divided in two sub-grids,
    Mesquite and New River areas.nnThe report comprises of two parts. For the first
    part, inversions and geophysical interpretation results are presented with some
    recommendations of the potential targets for future follow up on the property. The
    second part of the report describes logistics of the survey, survey parameters,
    methodology and the survey results (data) in digital documents.nnThe report reviews
    a Spartan MT survey carried out by Quantec Geoscience Limited over the New River
    Project in California, USA on behalf of Ram Power Inc. Data was acquired over a
    period of 29 days from 2010/06/26 to 2010/07/24.",nt"license_title": "Creative
